import React from "react";
import styled from "styled-components";
function App() {
  return (
    <StyledMainDiv>
      <h1>It's ok</h1>
    </StyledMainDiv>
  );
}

const StyledMainDiv = styled.div`
  background: url("./images/background.jpg") no-repeat center;
  width: 100%;
  height: 100vh;
`

export default App;
